import React from 'react';
import './showTweets.css';
import ReactDOM from 'react-dom'
import EnterNewTweet from './enterNewtweet/enterNewTweet';


const ShowTweets = () => {
    return (


        <div className="ShowTweets">
            <EnterNewTweet />
        </div>
    );
}

ReactDOM.render(
    <ShowTweets />,
    document.getElementById('root')
)

